        }

        //Settings 화면 Disconnect 커맨드
        private void ExecuteDisconnect(object parameter)
        {
            try
            {
                if (modbusTCP.connected)
                {
                    if (LampStatus == 1)
                    {
                        mirrtimer.Stop();
                        timer.Stop();
                        modbusTCP.WriteSingleCoils(0, byte.Parse(settings.axisNumselect.SelectedValue.ToString()), 96, false);
                        Debug.WriteLine(LampStatus.ToString());
                    }
                    settings.Disconnect.IsEnabled = false;
                    worker1.RunWorkerAsync();
                    StatusBar = "접속 종료중...";
                }
                else
                {
                    StatusBar = "통신 연결 상태가 아님";
                    return;
                }
            }
            catch (Exception e)
            {
                MessageBox.Show(e.Message, "예외발생_Disconnect", MessageBoxButton.OK, MessageBoxImage.Asterisk);
            }
        }

        private void Worker1_DoWork(object sender, DoWorkEventArgs e)
        {
            mirrtimer.Stop();
            timer.Stop();
            worker2.CancelAsync();
            worker3.CancelAsync();            
            for (int i=0; i<10; i++)
            {
                Thread.Sleep(500);
                Count += 23;
            }
            Count = 0;
            modbusTCP.disconnect();
            ModbusOnStatus = modbusTCP.connected;
            StatusBar = "접속 종료";
            AlarmStatus = 0;
            LampStatus = 0;
            ModbusOnStatus = false;
            ErrorCode = "00.0";
            MirrorONOFF = false;
        }

        private void Worker1_RunWorkerCompleted(object sender, RunWorkerCompletedEventArgs e)
        {
            MessageBox.Show("접속 종료");
            StatusBar = "접속 종료";
        }

